import React from 'react';
import ReactDOM from 'react-dom/client';
import GetData from '../service/logementService';
import '../src/styles/Index.css';
import '../src/styles/Normalize.css';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Accueil from './pages/Accueil';
import Header from './components/Header';
import Logement from './pages/Logement';
import About from './pages/About';
import Error from './pages/Error';
import Footer from './components/Footer';

const resultFetch = GetData("/db/logements.json");
const locations = resultFetch.data;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
      <Router>
        <Header />
        {locations.map((location, index) => (
        <Routes>
          <Route excat path="/" element={<Accueil />} />
          <Route excat path={`/logement?id=${location.id}`} element={<Logement />} />
          <Route excat path="/about" element={<About />} />
          <Route excat path="/*" element={<Error />} />
        </Routes>
        ))}
        <Footer />
      </Router>
    </React.StrictMode>,
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();


